/*Data for the table `tb_article` */

insert  into `tb_article`(`id`,`article_title`,`article_addtime`,`article_content`,`article_type`,`article_author`) values (21,'公告:商城正式营业，欢迎购买','2018-12-03 14:38:55','商城正式营业，欢迎购买',1,'admin'),(22,'公告：消费者购买享受15%的现金补贴！合伙人消费享受商城的分红！','2018-12-03 16:36:28','<p>\n	公告：消费者购买享受15%的现金补贴！合伙人消费享受商城的分红！\n</p>\n<p>\n	合伙人当月消费，次月分红。\n</p>\n<p>\n	事业合伙人“个人消费积分”满300积分，次月可享受商城的日分红、周分红。\n</p>\n<p>\n	高级合伙人“个人消费积分”满400积分，次月可享受商城的日分红、周分红、月分红。\n</p>\n<p>\n	创始合伙人“个人消费积分”满500积分，可享受日分红、周分红、月分红、季分红、年分红（获的年分红需连续完成一个自然年度每月的相应级别的“个人消费积分”考核）。\n</p>',1,'admin');

