/*Table structure for table `tb_invoice` */

DROP TABLE IF EXISTS `tb_invoice`;

CREATE TABLE `tb_invoice` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `invoice_type` int(2) NOT NULL COMMENT '发票类型（1个人/2企业）',
  `invoice_title` varchar(50) DEFAULT '' COMMENT '发票抬头(公司名称)',
  `invoice_duty_paragraph` varchar(20) DEFAULT '' COMMENT '税号',
  `invoice_open_bank` varchar(20) DEFAULT '' COMMENT '开户行',
  `invoice_bank_card` varchar(20) DEFAULT '' COMMENT '银行账号',
  `invoice_compay_address` varchar(100) DEFAULT '' COMMENT '企业地址',
  `invoice_tel` varchar(11) DEFAULT '' COMMENT '电话',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID（外键）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='发票表';

/*Data for the table `tb_invoice` */

