/*Table structure for table `tb_order` */

DROP TABLE IF EXISTS `tb_order`;

CREATE TABLE `tb_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `pay_num` varchar(30) DEFAULT '' COMMENT '大订单号(支付回调使用)',
  `order_addtime` varchar(20) DEFAULT '' COMMENT '添加时间',
  `order_num` varchar(30) DEFAULT '' COMMENT '订单编号',
  `receiver_name` varchar(50) DEFAULT '' COMMENT '收货人姓名',
  `receiver_tel` varchar(11) DEFAULT '' COMMENT '收货人联系方式',
  `receiver_address` text COMMENT '收货人地址',
  `receiver_postcode` varchar(10) DEFAULT '' COMMENT '收货人邮编',
  `order_status` int(2) DEFAULT '1' COMMENT '订单状态（1待支付/2待发货/3待收货/4待评价/5交易成功/6取消订单/7退货退款）',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品ID',
  `goods_parameter` varchar(100) DEFAULT '' COMMENT '所选商品参数',
  `goods_amount` int(10) DEFAULT '0' COMMENT '商品数量',
  `goods_price` float(12,2) DEFAULT '0.00' COMMENT '商品零售单价',
  `goods_supply_price` float(12,2) DEFAULT '0.00' COMMENT '商品供货总价',
  `goods_actual_price` float(12,2) DEFAULT '0.00' COMMENT '实际		支付价格',
  `goods_freight` float(12,2) DEFAULT '0.00' COMMENT '运费',
  `goods_integral` int(11) DEFAULT '0' COMMENT '此订单所获积分(总积分)',
  `store_id` int(11) DEFAULT '0' COMMENT '店铺ID',
  `user_id` int(11) DEFAULT '0' COMMENT '用户ID',
  `oreder_pay_type` int(2) DEFAULT NULL COMMENT '支付方式(1微信2支付宝3银联4分红)',
  `order_pay_num` varchar(50) DEFAULT '' COMMENT '支付交易号',
  `order_pay_time` varchar(20) DEFAULT '' COMMENT '支付时间',
  `order_shipments_time` varchar(20) DEFAULT '' COMMENT '发货时间',
  `order_takegoods_time` varchar(20) DEFAULT '' COMMENT '收货时间',
  `order_evaluate_time` varchar(20) DEFAULT '' COMMENT '评价时间',
  `invoice_type` int(2) DEFAULT NULL COMMENT '发票（1个人/2企业/3不开）',
  `invoice_title` varchar(50) DEFAULT '' COMMENT '发票抬头',
  `invoice_duty_paragraph` varchar(20) DEFAULT '' COMMENT '税号',
  `invoice_open_bank` varchar(20) DEFAULT '' COMMENT '开户行',
  `invoice_bank_card` varchar(20) DEFAULT '' COMMENT '银行账号',
  `invoice_compay_address` varchar(100) DEFAULT '' COMMENT '企业地址',
  `invoice_tel` varchar(11) DEFAULT '' COMMENT '电话',
  `logistics_company` varchar(50) DEFAULT '' COMMENT '物流公司编码(顺丰:sf 申通:sto 圆通:yt 韵达:yd 天天:tt)',
  `logistics_num` varchar(50) DEFAULT '' COMMENT '物流编号',
  `user_isdelete_flag` int(2) DEFAULT '1' COMMENT '是否删除（用户）1正常   2删除',
  `store_isdelete_flag` int(2) DEFAULT '1' COMMENT '是否删除（店铺）1正常   2删除',
  `plate_isdelete_flag` int(2) DEFAULT '1' COMMENT '是否删除（后台）1正常   2删除',
  `isdiscount_flag` int(2) DEFAULT '0' COMMENT '是否使用折扣 0正常   1使用',
  `reasons` varchar(30) DEFAULT '' COMMENT '取消订单理由',
  `remind_time` varchar(20) DEFAULT '' COMMENT '提醒时间',
  `remind_num` tinyint(1) DEFAULT '0' COMMENT '提醒次数',
  `msg` varchar(100) DEFAULT '' COMMENT '买家留言',
  `commission` float(12,2) DEFAULT '0.00' COMMENT '推荐产品销售提成',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=494 DEFAULT CHARSET=utf8 COMMENT='订单';

