/*Table structure for table `tb_profit_hiostory` */

DROP TABLE IF EXISTS `tb_profit_hiostory`;

CREATE TABLE `tb_profit_hiostory` (
  `addtime` varchar(20) DEFAULT NULL COMMENT '发放日期',
  `profit_hiostory_date` varchar(20) DEFAULT NULL COMMENT '对应上个月日期',
  `profit_hiostory_end_date` varchar(20) DEFAULT NULL COMMENT '对应上个月结束日期',
  `sum_profit_money` float(12,2) DEFAULT NULL COMMENT '总分红金额',
  `userIds` text COMMENT '发放的用户ID',
  `profit_type` int(2) DEFAULT NULL COMMENT '分红类型（1日/2周/3月/4季/5年/6产品销售总额）'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分红历史';

/*Data for the table `tb_profit_hiostory` */

/*Table structure for table `tb_profit_withdraw_log` */

DROP TABLE IF EXISTS `tb_profit_withdraw_log`;

CREATE TABLE `tb_profit_withdraw_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_role` int(2) DEFAULT NULL COMMENT '用户角色（1用户2商铺）',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID（外键）',
  `application_time` varchar(50) DEFAULT '' COMMENT '申请时间',
  `withdraw_type` varchar(50) DEFAULT '' COMMENT '提现方式',
  `withdraw_account` varchar(50) DEFAULT '' COMMENT '提现账号',
  `withdraw_money` float(12,2) DEFAULT '0.00' COMMENT '提现金额',
