/*Table structure for table `tb_refund_log` */

DROP TABLE IF EXISTS `tb_refund_log`;

CREATE TABLE `tb_refund_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `application_time` varchar(20) DEFAULT '' COMMENT '申请时间',
  `finish_time` varchar(20) DEFAULT '' COMMENT '完成时间',
  `refund_type` int(11) DEFAULT NULL COMMENT '类型（1仅退款/2退货退款）',
  `order_num` varchar(20) DEFAULT NULL COMMENT '订单编号',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `store_id` int(11) DEFAULT NULL COMMENT '商铺ID',
  `refund_big_status` int(2) DEFAULT '1' COMMENT '大状态（1申请中/2完成）',
  `refund_small_status` int(2) DEFAULT '1' COMMENT '小状态（1申请中/2商铺第一次同意(买家填写物流信息)/3等待卖家收货）',
  `refund_money` float(12,2) DEFAULT NULL COMMENT '退款金额',
  `logistics_company` varchar(50) DEFAULT NULL COMMENT '物流公司',
  `logistics_num` varchar(50) DEFAULT NULL COMMENT '物流编号',
  `reasons` varchar(30) DEFAULT '' COMMENT '退款原因',
  `msg` varchar(100) DEFAULT '' COMMENT '退款说明',
  `goods_status` tinyint(1) DEFAULT '1' COMMENT '货物状态:1未收到货 2已收到货',
  `store_name` varchar(10) DEFAULT NULL COMMENT '店铺收货人姓名',
  `store_phone` varchar(11) DEFAULT '' COMMENT '店铺收货人电话',
  `store_addr` varchar(100) DEFAULT '' COMMENT '店铺收货地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='退货退款记录';

