  `trade_mark_authorization_photo` varchar(100) DEFAULT NULL COMMENT '商标授权书照片',
  `production_license_number` varchar(100) DEFAULT NULL COMMENT '生产许可证标号',
  `production_license_valid_date` varchar(50) DEFAULT NULL COMMENT '生产许可证有效期',
  `production_license_photo` varchar(100) DEFAULT NULL COMMENT '生产许可证照片',
  `business_license_number` varchar(100) DEFAULT NULL COMMENT '经营许可编号',
  `business_license_valid_date` varchar(50) DEFAULT NULL COMMENT '经营许可证有效期',
  `business_license_photo` varchar(100) DEFAULT NULL COMMENT '经营许可证照片',
  `actual_operator_name` varchar(100) DEFAULT NULL COMMENT '实际运营人',
  `actual_operator_qq` varchar(10) DEFAULT NULL COMMENT 'QQ号码',
  `actual_operator_weixin` varchar(15) DEFAULT NULL COMMENT '微信',
  `actual_operator_tel` varchar(100) DEFAULT NULL COMMENT '联系电话',
  `actual_operator_email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `general_leader_name` varchar(50) DEFAULT NULL COMMENT '总负责人姓名',
  `general_leader_tel` varchar(11) DEFAULT NULL COMMENT '手机号',
  `general_leader_weixin` varchar(15) DEFAULT NULL COMMENT '微信号',
  `referrer_name` varchar(50) DEFAULT '' COMMENT '推荐人姓名',
  `referrer_level` varchar(100) DEFAULT '' COMMENT '推荐人级别',
  `referrer_id` varchar(20) DEFAULT NULL COMMENT '推荐人分享ID(邀请码)',
  `referrer_tel` varchar(11) DEFAULT '' COMMENT '推荐人电话',
  `service_amount` varchar(5) DEFAULT NULL COMMENT '客服人数',
  `work_time` varchar(100) DEFAULT NULL COMMENT '工作时间',
  `general_taxpayer_photo` varchar(100) DEFAULT NULL COMMENT '一般纳税人资格证照片',
  `product_test_report_photo` varchar(100) DEFAULT NULL COMMENT '产品检测报告照片',
  `store_name` varchar(100) DEFAULT NULL COMMENT '商铺名称',
  `store_introduce` text COMMENT '商铺介绍',
  `store_contact_people` varchar(50) DEFAULT NULL COMMENT '商铺联系人',
  `store_contact_people_tel` varchar(11) DEFAULT NULL COMMENT '商铺联系人电话',
  `server_qq` varchar(10) DEFAULT NULL COMMENT '客服QQ',
  `store_logo` varchar(100) DEFAULT NULL COMMENT '店铺logo',
  `store_pay_password` varchar(50) DEFAULT NULL COMMENT '店铺交易密码',
  `store_nick` varchar(100) DEFAULT '' COMMENT '店铺后台用户名',
  `store_password` varchar(50) DEFAULT '' COMMENT '店铺后台密码',
  `store_number` varchar(10) DEFAULT '' COMMENT '商铺编号',
  `store_status` int(2) DEFAULT '5' COMMENT '商铺状态（1正常2打烊3强制关闭4驳回5待审核-1删除）',
  `reject_reason` text COMMENT '驳回理由',
  `force_close_reason` text COMMENT '强制关闭理由',
  `store_classify` int(11) DEFAULT NULL COMMENT '商铺类型（一级分类ID）',
  `role` int(1) DEFAULT '1' COMMENT '角色',
  `store_account` float(12,2) DEFAULT '0.00' COMMENT '商铺账户',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=utf8 COMMENT='商铺';

