/*Table structure for table `tb_sysconfig` */

DROP TABLE IF EXISTS `tb_sysconfig`;

CREATE TABLE `tb_sysconfig` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `tourists_shop_discount` int(5) DEFAULT '85' COMMENT '游客购物折率（默认85折0~100）',
  `withdrawal_charge_per` double(5,2) DEFAULT '2.00' COMMENT '提现手续费比列（默认2% 0~100）',
  `boutique_area_per` double(5,2) DEFAULT '100.00' COMMENT '精品区积分兑换比列（默认100% 0~100）',
  `consume_area_per` double(5,2) DEFAULT '50.00' COMMENT '消费区积分兑换比列（默认50% 0~100）',
  `primary_career_integral_rules` int(10) DEFAULT '1500' COMMENT '事业合伙人积分考核标准（默认1500）',
  `primary_career_continuous_month` int(5) DEFAULT '1' COMMENT '事业合伙人连续月份标准（默认 1 个月 从注册日算起）',
  `primary_career_personal_integral` int(10) DEFAULT '300' COMMENT '事业合伙人个人消费积分标准（默认300）',
  `advanced_career_integral_rules` int(10) DEFAULT '60000' COMMENT '高级合伙人考核标准（默认60000）',
  `advanced_career_continuous_month` int(5) DEFAULT '3' COMMENT '高级合伙人连续月份标准（默认 3 个月 从注册日算起）',
  `advanced_career_personal_integral` int(10) DEFAULT '400' COMMENT '高级合伙人个人消费积分标准（默认400）',
  `initiate_career_integral_rules` int(10) DEFAULT '150000' COMMENT '创始合伙人考核标准（默认150000）',
  `initiate_career_continuous_month` int(5) DEFAULT '6' COMMENT '创始合伙人连续月份标准（默认 6 个月 从注册日算起）',
  `initiate_career_personal_integral` int(10) DEFAULT '500' COMMENT '创始合伙人个人消费积分标准（默认500）',
  `operating_costs_per` double(5,2) DEFAULT '20.00' COMMENT '运营成本（默认20% 0~100）',
  `special_contribute_award` double(5,2) DEFAULT '5.00' COMMENT '特殊贡献奖（默认5% 0~100）',
  `year_profit_continuous_month` int(5) DEFAULT '24' COMMENT '年分红连续月份标准（默认24个月）',
  `recommend_shop_column` double(5,2) DEFAULT '5.00' COMMENT '推荐商家比列（默认5% 0~100）',
  `day_profit_per` double(5,2) DEFAULT '40.00' COMMENT '日分红比列（默认40% 0~100）',
  `week_profit_per` double(5,2) DEFAULT '30.00' COMMENT '周分红比列（默认30% 0~100）',
  `month_profit_per` double(5,2) DEFAULT '20.00' COMMENT '月分红比列（默认20% 0~100）',
  `quarter_profit_per` double(5,2) DEFAULT '8.00' COMMENT '季度分红（默认8%）',
  `year_profit_per` double(5,2) DEFAULT '5.00' COMMENT '年分红（默认5%）',
  `one_partner_per` double(5,2) DEFAULT NULL COMMENT '一级下线比列',
  `two_partner_per` double(5,2) DEFAULT NULL COMMENT '二级下线比列',
  `copyright` varchar(100) DEFAULT NULL COMMENT '底部版权信息',
  `sensitive_word` text COMMENT '敏感词',
  `keywords` text COMMENT '关键词',
  `description` text COMMENT '描述',
  `automatic_receiving_time` int(5) DEFAULT '15' COMMENT '自动收货时间',
  `automatic_evaluate_time` int(5) DEFAULT '7' COMMENT '自动评价时间',
  `weixin_pay_flag` int(2) DEFAULT '2' COMMENT '微信（1启用2不启用）',
  `ali_pay_flag` int(2) DEFAULT '2' COMMENT '支付宝（1启用2不启用）',
  `unionpay_pay_flag` int(2) DEFAULT '2' COMMENT '银联（1启用2不启用）',
  `shareprofit_pay_flag` int(2) DEFAULT '2' COMMENT '分红（1启用2不启用）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='系统配置';

