/*Table structure for table `tb_transfer_log` */

DROP TABLE IF EXISTS `tb_transfer_log`;

CREATE TABLE `tb_transfer_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `transfer_addtime` varchar(20) DEFAULT NULL COMMENT '转账时间',
  `transfer_userid` int(11) DEFAULT NULL COMMENT '转账人（用户ID）',
  `transfer_money` float(12,2) DEFAULT NULL COMMENT '转账金额',
  `transfer_recevier_tel` varchar(11) DEFAULT NULL COMMENT '接收人（手机号）',
  `transfer_receiver_userid` int(11) DEFAULT '0' COMMENT '接收人用户ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='转账记录';

