/*Table structure for table `tb_user` */

DROP TABLE IF EXISTS `tb_user`;

CREATE TABLE `tb_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_addtime` varchar(20) DEFAULT '' COMMENT '注册时间（成为普通用户的时间）',
  `user_primary_career_time` varchar(20) DEFAULT '' COMMENT '成为事业合伙人的时间',
  `user_advanced_career_time` varchar(20) DEFAULT '' COMMENT '成为高级合伙人的时间',
  `user_initiate_career_time` varchar(20) DEFAULT '' COMMENT '成为创始合伙人的时间',
  `last_login_time` varchar(20) DEFAULT '' COMMENT '最后一次登录时间',
  `login_IP` varchar(20) DEFAULT '' COMMENT '登录IP',
  `user_shareid` varchar(20) DEFAULT '' COMMENT '用户分享ID',
  `user_nick` varchar(20) DEFAULT '' COMMENT '用户名（昵称）',
  `user_password` varchar(50) NOT NULL DEFAULT '' COMMENT '密码',
  `user_pay_password` varchar(50) DEFAULT '' COMMENT '支付密码',
  `user_truename` varchar(20) DEFAULT '' COMMENT '真实姓名',
  `user_ID_number` varchar(20) DEFAULT '' COMMENT '身份证号',
  `user_tel` varchar(11) NOT NULL DEFAULT '' COMMENT '手机号码',
  `user_alipay_account` varchar(50) DEFAULT '' COMMENT '支付宝帐号',
  `user_role` int(2) DEFAULT '1' COMMENT '角色（1普通用户2事业合伙人3高级合伙人4创始合伙人）',
  `user_check_integral` int(11) DEFAULT '0' COMMENT '考核积分',
  `user_profit_account` float(12,2) DEFAULT '0.00' COMMENT '分红账户',
  `user_personal_integral` int(11) DEFAULT '0' COMMENT '个人消费总积分账户',
  `user_distribution_integral` int(11) DEFAULT '0' COMMENT '分销积分账户',
  `user_personal_month_integral` int(11) DEFAULT '0' COMMENT '个人当月消费积分账户',
  `user_personal_lastmonth_integral` int(11) DEFAULT '0' COMMENT '个人上月消费积分账户',
  `user_sharprofit_count` float(12,2) DEFAULT '0.00' COMMENT '总分润账户',
  `user_sharprofit_month` float(12,2) DEFAULT '0.00' COMMENT '当月分润账户（推荐商铺）',
  `user_status` int(2) DEFAULT '1' COMMENT '用户状态（1正常2禁用-1删除）',
  `parent_shareid` varchar(20) DEFAULT '' COMMENT '父级分享ID',
  `agreement_level` int(2) DEFAULT '1' COMMENT '协议等级（1普通会员状态（默认）2初级事业合伙人3高级...4创始....）',
  `qr_code_url` varchar(50) DEFAULT '' COMMENT '二维码路径',
  `year_profit_continuous_month` int(5) DEFAULT '0' COMMENT '分红发放连续月份',
  `user_head` varchar(120) DEFAULT '' COMMENT '用户头像',
  `return_times` int(11) DEFAULT '0' COMMENT '当前角色等级清回初始化考核积分次数',
  PRIMARY KEY (`id`)
